import React from 'react';
import NavDropdown from 'react-bootstrap/NavDropdown';

export default function DropdownCategory(name) {
  return (
    <>
      <NavDropdown.Item href={`/${name}`}>{name}</NavDropdown.Item>
      <NavDropdown.Divider />
    </>
  );
}
